import React from 'react';

import './Main.css';
import {
    BrowserRouter as Router,
    Route,
    Link
} from "react-router-dom";
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Input,
    Button
} from 'reactstrap';

export default class Main extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <Route>
                <div className='main bg-faded'>
                <div className='container'></div>
                </div>
            </Route>
        );
    }
}
